    data: |
      SELECT DISTINCT 12 * - col1 + + 42 - + - col2 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT NULL BETWEEN col2 / - col0 AND col1 + - col1 * 89 + + col2 OR NOT NULL IS NULL;
  - name: tab1

outputs:
  - name: q1109.out
    data: |
